import './App.css';
import Header from './components/header/header';
import Content from './components/content/content';
import Navbar from './components/navbar/navbar';
import {BrowserRouter} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Header />
      <Content />
      <Navbar />
    </div>
    </BrowserRouter>
  );
}

export default App;
